import React from 'react';
import './Auth.css';

const Login = () => {



  return (
    <div className="Login">
      <h1>Login</h1>
      <div className="Container">
      <div className="Form">
        <form>
          <label>
            Email:
            <input type="email" name="email" />
          </label>
          <label>
            Password:
            <input type="password" name="password" />
          </label>
          <button type="submit">Login</button>
        </form>
        </div>
      </div>
    </div>
  );
}
export default Login;
